import Header from './Components/Header'
import About from './Components/About'
import Service from './Components/Service';
import Blog from './Components/Blog';
import Login from './Components/Login';

function App() {
  return (
    <div>
      <Header/>
      <About/>
      <Service/>
      <Blog/>
      <Login/>
    </div>
  );
}

export default App;
